import * as React from 'react';
import ImageList from '@mui/material/ImageList';
import ImageListItem from '@mui/material/ImageListItem';
import banner from './assets/banner.jpg'

export default function Images() {
  return (
    <ImageList sx={{  height: 500}} cols={4} rowHeight={164}>
      {itemData.map((item) => (
        <ImageListItem key={item.img}>
          <img
            src={`${item.img}?w=164&h=164&fit=crop&auto=format0`}
            srcSet={`${item.img}?w=164&h=164&fit=crop&auto=format&dpr=2 2x`}
            alt={item.title}
            loading="lazy"
          />
        </ImageListItem>
      ))}
    </ImageList>
  );
}

const itemData = [
  {
    img: 'https://images.unsplash.com/',
    title: 'Breakfast',
  },
  {
    img: 'https://images.unsplash.com/',
    title: 'Burger',
  },
  {
    img: 'https://images.unsplash.com/photo-1589829545856-d10d557cf95f',
    title: 'Camera',
  },
  {
    img: 'https://images.unsplash.com/photo-1447968954315-3f0c44f7313c',
    title: 'Coffee',
  },

];
